import React from "react";
import "./MainPage.css";
import { usePhotos } from "../../hooks";

const MainPage = () => {
  const { photos, isLoading } = usePhotos('new+york');

  if(isLoading) return <></>;

  return (
  <span>main Page with {photos?.perpage}</span>
  );
}

export default MainPage;
